import { useMutation } from "react-query"
import { userApi } from "../../../service/userApi"
import { orderApi } from "../../../service/orderApi"

export const useFindOneUser = () => {
    const { mutateAsync: findOneUser } = useMutation('user', (params: { email: string, phone: string }) => userApi.findOneUser(params.email, params.phone), {
        onSuccess: () => {

          alert('User Saved Successfully')
        },

        onError: (error: any) => {
          alert(error)

        },
      })
      return {findOneUser}
    }

    export const useFindAllOrder = () => {
        const { mutateAsync: findAllOrder } = useMutation('user', (user_id: number) => orderApi.findOrder(params.user_id), {
            onSuccess: () => {

              alert('User Saved Successfully')
            },

            onError: (error: any) => {
              alert(error)

            },
          })
          return {findAllOrder}
        }
